Классификация климатов Кёппена — одна из наиболее распространённых систем классификации типов климата. Классификация была разработана немецко-русским климатологом Владимиром Петровичем Кёппеном в 1900 году (с некоторыми дальнейшими изменениями в 1918 и 1936 годах, сделанными им самим). Она основывается на концепции, в соответствии с которой наилучшим критерием типа климата является то, какие растения растут на данной территории в естественных условиях. Классификация основана на учёте режима температуры и осадков. Намечается 5 типов климатических зон, а именно: 
*  А — влажная тропическая зона без зимы; 
*  В — две сухие зоны, по одной в каждом полушарии; 
*  С — две умеренно тёплые зоны без регулярного снежного покрова; 
*  D — две зоны бореального климата на материках с резко выраженными границами зимой и летом; 
*  Ε — две полярные области снежного климата. Границы между зонами проводятся по определённым изотермам самого холодного и самого тёплого месяцев и по соотношению средней годовой температуры и годового количества осадков при учёте годового хода осадков. Внутри зон типов А, С и D различаются климаты с сухой зимой (w), сухим летом (s) и равномерно влажные (f). Сухие климаты по соотношению осадков и температуры делятся на климаты степей (BS) и климаты пустынь (BW), полярные климаты — на климат тундры (ЕТ) и климат вечного (постоянного) мороза (EF). Таким образом, получается 11 основных типов климата (см. ниже). Для дальнейшей детализации вводятся 23 дополнительных признака и соответствующие индексы (а, b, c, d и т. д.), основанные на деталях в режиме температуры и осадков. Многие типы климатов по классификации климатов Кёппена известны под названиями, связанными с характерной для данного типа растительностью. Буквенные обозначения для климатической классификации Кёппена (названия могут повторяться, так как схема Кёппена не совпадает с поясной схемой): 
*  A — тропический и экваториальный; 
*  B — сухой, субэкваториальный, тропический; 
*  C — умеренный, субтропический и континентальный; 
*  D — континентальный, субарктический (бореальный); 
*  E — полярный, субарктический, арктический; 
*  Af — климат тропических лесов; 
*  Aw — климат саванн; 
*  BS — климат степей; 
*  BW — климат пустынь; 
*  Cs — климат умеренно тёплый с сухим летом (средиземноморский); 
*  Cw — климат умеренно тёплый с сухой зимой; 
*  Cf — климат умеренно тёплый с равномерным увлажнением; 
*  Ds — климат умеренно холодный с сухим летом; 
*  Dw — климат умеренно холодный с сухой зимой; 
*  Df — климат умеренно холодный с равномерным увлажнением; 
*  ЕТ — климат тундры; 
*  EF — климат постоянного мороза. Дополнительные буквы (третья для самого жаркого, четвёртая для самого холодного месяца в году): 
*  i — сильнейшая жара: 35 °C и выше; 
*  h — очень жарко: 28 — 35 °C; 
*  a — жарко: 23 — 28 °C; 
*  b — тепло: 18 — 23 °C; 
*  l — средне: 10 — 18 °C; 
*  k — прохладно: 0 — 10 °C; 
*  o — холодно: −10 … 0 °C; 
*  c — очень холодно: −25 … −10 °C; 
*  d — мучительно холодно: −40 … −25 °C; 
*  e — вечная мерзлота: −40 °C и ниже. Например: 
*  BWhl (Асуан, Египет) — пустынный климат с температурой июля 28—35 °C, января 10—18 °C; 
*  Dfbo (Москва, Россия) — умеренно-холодный (континентальный) с температурой июля 18—23 °C, января −10 … 0 °C; 
*  Cshk (Анталия, Турция) — средиземноморский климат с температурой июля 28—35 °C, января 0—10 °C.
